import React from "react";

function UploadFile() {
    return (
        <div className="container">
            <div>
                <form>
                    <h3>React File Upload</h3>
                    <div className="form-group">
                        <input type="file" />
                    </div>
                    <div className="form-group">
                        <button type="submit">Upload</button>
                    </div>
                </form>
            </div>
        </div>
    );
}

export default UploadFile;
